import {combineReducers} from 'redux';
import {weatherInfo} from '../reducers/weatherReducer';
import oneReducer from '../reducers/oneReducer';

const rootReducer = conmbineReducers ({
    oneReducer,
    weatherInfo
});

export default rootReducer;
